import React, {useState} from 'react';
import axios from 'axios';

function GetAllAccounts() {
    const [users, setUsers] = useState('')

    axios.get('http://localhost:8080/accounts/')
        .then(res=> {
           setUsers(res.data.map)
        }).catch(err => {
            console.log(err)
    })

    return (
        <p>{users}</p>
    )
}

export default GetAllAccounts;
